package com.joken.common.printer;

import java.util.Arrays;
import java.util.HashMap;
import java.util.LinkedList;
import java.util.List;
import java.util.Map;

import com.joken.common.utils.StringUtils;

/**
 * 打印任务工具类
 * 
 * @author wangby
 * @date 2016年6月15日上午11:07:58
 */
public class PrinterTaskUtils {

	private PrinterTaskUtils() {
	}

	/**
	 * @param printContent
	 *            打印内容
	 * @param dtuCode
	 *            打印机dtu标识
	 * @param taskTimestamp
	 *            打印任务标识
	 * @param parentTimestamp
	 *            记录数据库标识
	 * @param reserveTime
	 *            预约取货时间标识 10:00:00-11:30:00-0 横杠中间为预约取货时间
	 * 
	 * @return LinkedList<Map<String,String>> 拆分后的打印任务列表
	 * @date 2016年6月15日下午2:38:53
	 */
	public static LinkedList<Map<String, String>> getTasks(String printContent,
			String dtuCode, String taskTimestamp, String parentTimestamp,
			String reserveTime) {
		if (StringUtils.isEmpty(printContent) || StringUtils.isEmpty(dtuCode)
				|| StringUtils.isEmpty(taskTimestamp)
				|| StringUtils.isEmpty(parentTimestamp)
				|| StringUtils.isEmpty(reserveTime)) {
			return null;
		}
		printContent = printContent.replaceAll("\r", "").replaceAll(
				"SOUND 5,400\n", "");
		LinkedList<Map<String, String>> tasks = new LinkedList<Map<String, String>>();
		String[] contentArray = ("\n" + printContent).split("CLS");
		List<String> contentList = Arrays.asList(contentArray);
		LinkedList<String> printContents = new LinkedList<String>();
		PrinterTaskUtils.despratePrintContent(contentList, printContents);
		Map<String, String> printTask = null;

		for (int i = 0; i < printContents.size(); i++) {
			printContent = printContents.get(i);
			if (printContents.size() > 1) {
				taskTimestamp = String.valueOf(taskTimestamp + "-" + (i + 1));
			}
			printTask = new HashMap<String, String>();
			printTask.put("dtuCode", dtuCode);
			printTask.put("taskTimestamp", taskTimestamp);
			printTask.put("taskData", printContent);
			printTask.put("parentTimestamp", parentTimestamp);
			printTask.put("reserveTime", reserveTime);
			printTask.put("taskState", "0");
			printTask.put("queryNum", "1");
			tasks.add(printTask);
		}

		return tasks;
	}

	public static void main(String[] args) {
		// String printStrHex =
		// "";
		// String printStr = CodeConvertUtils.hexString2String(printStrHex)
		// .replaceAll("\r", "").replaceAll("SOUND 5,400\n", "");
		String printStr = "SOUND 5,400\nSOUND 5,400\nSIZE 60 mm, 50 mm\nGAP 2 mm,0 mm\nOFFSET 0 mm\nCLS\nTEXT 96,32,'TSS24.BF2',0,1,1,'乐栈[嘉和一品广源店]'\nTEXT 32,64,'TSS24.BF2',0,1,1,'华天云超市[06.02 23:23]'\nTEXT 90,96,'TSS24.BF2',0,1,1,'宫保鸡丁盖饭 x 2'\nTEXT 90,128,'TSS24.BF2',0,1,1,'蛋炒肉 x 1'\nTEXT 64,300,'TSS24.BF2',0,1,2,'A09'\nBARCODE 180,260,'EAN13',64,1,0,2,2,'000000000000'\nTEXT 150,368,'TSS24.BF2',0,1,1,'快乐生活 一栈到底'\nPRINT 1,1\nCLS\nSIZE 60 mm, 50 mm\nGAP 2 mm,0 mm\nOFFSET 0 mm\nCLS\nTEXT 32,32,'TSS24.BF2',0,1,1,'乐栈（汇总）[16.06.15 15:00]'\nTEXT 32,64,'TSS24.BF2',0,1,1,'宫保鸡丁盖饭 x 2'\nTEXT 32,96,'TSS24.BF2',0,1,1,'蛋炒肉 x 1'\nPRINT 1,1\nCLS\n";
		System.out.println(PrinterTaskUtils.getTasks(printStr, "849350100007",
				"1465956000000-N-10:00:00-11:30:00-0", "1465956000000",
				"10:00:00-11:30:00-0"));
	}

	private static List<String> despratePrintContent(List<String> contentList,
			LinkedList<String> printTasks) {
		int byteLength = 264;
		StringBuffer sBuffer = new StringBuffer();
		String content = null;
		int tmp = 0;
		for (int i = 0; i < contentList.size(); i++) {
			content = contentList.get(i);
			tmp = content.getBytes().length;
			if (tmp < 3) {
				continue;
			}
			byteLength += tmp + 10;
			if (byteLength > 30720) {
				contentList = contentList.subList(i, contentList.size());
				printTasks.add(sBuffer.toString());
				return despratePrintContent(contentList, printTasks);
			}
			sBuffer.append("\nCLS").append(content).append("CLS");
		}
		printTasks.add(sBuffer.toString());
		return contentList;
	}
}
